window.bookSummaryJSON = "<p>If you really have so much potential...why are you not using all of it? The latest brain science delivers the answers you need to break free and unlock the hidden power of your subconscious mind so you can earn more, live more, and achieve more than ever before.</p> <p>By using the latest technology and evidence based brain training techniques, you can release years of old programming and limiting beliefs or habits that keep you stuck achieving the same results over and over again.</p> <p>Learn powerful brain-based methods, elite athletes, navy seals, CEOs, and astronauts use to perform at the highest levels possible.</p> <p>Innercise is a revolutionary process that will ignite and unleash your brain’s hidden power and show you the fastest path to maximizing your full potential, so you achieve your greatest victories and successes.</p> <p>In this groundbreaking audiobook, you will discover the most advanced, cutting edge tools, and techniques to:</p> <p></p> <ul> <li>Recognize and release any mental or emotional obstacle that is holding you back from achieving your biggest goals and dreams.</li> <li>Increase your self-confidence and self-worth.</li> <li>Train your brain to focus on exactly how you will achieve your goals versus why you can’t.</li> <li>Eliminate any “inner” block such fear of failing, being embarrassed, ashamed, or judged.</li> <li>Enjoy life with greater significance, purpose, and meaning.</li> <li>Turn any fear into your fuel for success.</li> <li>Remove self-doubt and gain more certainty.</li> <li>Acquire more self-discipline and develop empowering habits.</li> <li>Strengthen your mindset and become unstoppable.</li> </ul> <p>The innercise revolution starts with you!</p>"; 
